import React from "react";
import './Logo.css';
import logoImage from '../Image/Logo.png';


const Logo = () => {
  return (
    <div className="Container-logo">
      <img src={logoImage} alt="Logo" className="logo-image"/>
      <h1>Family Market</h1>
    </div>
      
  );
}
export default Logo;
